import React, {Component} from 'react'
import User from './User';
import photo from './anakelly.jpg'

class Ana extends Component{
    render(){
    return (
        <div>
        Eu sou um componente chamado Ana
        <User name="Ana Kelly" photo={photo}></User>
        <User name="Renan Yuri"></User>
        <User name="Lucas"></User>

        </div>
    );
    }
}
export default Ana;
